import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <div className="App">
  <header className="App-header">
    <h1>Google Login</h1>

  </header>
</div>
);
